import './App.css';
import React from 'react';
import pokemons from './data';
import Pokedex from './Pokedex';

class App extends React.Component {
  render() {

    return (
      <div>
      <h1>Pokedex</h1>
      {pokemons.map( pokemon => <Pokemon key={pokemon.id} pokemon={pokemon}/>)}
      </div>
    );
  }
}

export default App;
